import React from 'react'
import { data } from '../data/data'
import { Link } from 'react-router-dom'

const Datashow = () => {
  return (
    <div>
    {data.map((item) => (
        <p key={item.id}><Link to={"/pages/" + item.id}>
            <img src={item.img} className='' />
            {item.title}
        </Link></p>
      ))}
    </div>
  )
}

export default Datashow
